import React from 'react'

const Header = (props) => {

  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}
const Content = (parts) => {

  console.log(parts.length)
  parts.forEach(value => {
    console.log(value)
  })
  return (
    <div>
      <p>{parts[1]["name"]}{parts[1]["exercises"]}</p>
      <p>{parts[2]["name"]}{parts[2]["exercises"]}</p>
      <p>{parts[3]["name"]}{parts[3]["exercises"]}</p>
    </div>
  )
}

const Total = (parts) => {

  return (
    <div>
      <p>Number of exercises {parts["exercises"] + parts["exercises"] + parts["exercises"]}</p>
    </div>
  )
}
const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
      <Total parts={parts} />
    </div>
  )
}

export default App
